styles:
@media screen and (orientation: landscape) {
    .AppUpsellHeader__background {
        height: 22vh;
    }
}
@media screen and (orientation: portrait) {
    .AppUpsellHeader__background {
        height: 10vh;
    }
}

html {
    background-color: #e9e9e9;
}

html, body {
    font-family: 'Helvetica Neue', Helvetica, 'ヒラギノ角ゴ Pro W3', 'Hiragino Kaku Gothic Pro', メイリオ, Meiryo,
                 'ＭＳ Ｐゴシック', arial, sans-serif;
    color: rgb(33, 25, 34);
    font-size: 12px;
    height: 100%;
}

body {
    position: relative;
    overflow-y: scroll;
}

input::-ms-clear {
    display: none;
}

a {
    color: #717171;
    font-weight: bold;
    text-decoration: none;
}

a:focus,
a:hover {
    color: #8a8a8a;
}

ul {
    margin: 0;
    padding: 0;
}

ul li {
    list-style: none;
    padding: 0;
}

:focus {
    outline: #d1d1d1 auto 1px
}

button, input, select, textarea {
    font-family: 'Helvetica Neue', Helvetica, 'ヒラギノ角ゴ Pro W3', 'Hiragino Kaku Gothic Pro', メイリオ, Meiryo,
                 'ＭＳ Ｐゴシック', arial, sans-serif;
    font-size: 100%;
    vertical-align: middle;
    margin: 0px;
}

.SkipToContent {
    display: none;
}


.UnauthHeader__headerContainer {
    display: -webkit-box;
    display: -webkit-flex;
    display: -ms-flexbox;
    display: flex;
}

.EuCookieBar__learnMore:hover, .EuCookieBar__learnMore:focus {
    text-decoration: underline;
}
.EuCookieBar__cookieButton {
    background-color: transparent;
    -webkit-text-size-adjust: 120%;
}
.EuCookieBar__cookieButton:hover, .EuCookieBar__cookieButton:focus {
    background-color: #999;
    opacity: 1;
}

@keyframes scrollFooterWithBgGrid {
    0% {
        transform: translateY(0px);
    }
    91% {
        transform: translateY(0px);
    }
    100% {
        transform: translateY(-30px);
    }
}
@keyframes scrollBgGridLinks {
    from {
        transform: translateY(0px);
    }
    to {
        transform: translateY(-330px);
    }
}

.MwebHomepage__background {

                background-image:
                    url("http://web.archive.org/web/20160901000610im_/https://s-passets-cache-ak0.pinimg.com/webapp/style/app/common/images/pin_grid-1x-9bd0bc61.jpg");
                    background-size: 344px 370px;
                    background-repeat: no-repeat;
}
.MwebHomepage__gradient {
    background-image: linear-gradient(to bottom, rgba(255, 255, 255, 0), #fff);
}

article,
aside,
details,
figcaption,
figure,
footer,
header,
hgroup,
nav,
section,
ul {
  display: block;
}

audio,
canvas,
video {
  display: inline-block;
}

audio:not([controls]) {
  display: none;
}

html {
  font-size: 100%;
  text-size-adjust: none;
}

a:hover,
a:active {
  outline: 0;
}

sub,
sup {
  position: relative;
  font-size: 75%;
  line-height: 0;
  vertical-align: baseline;
}
sup {
  top: -0.5em;
}
sub {
  bottom: -0.25em;
}

img {
  max-width: 100%;
  width: auto9;
  height: auto;

  vertical-align: middle;
  border: 0;
  -ms-interpolation-mode: bicubic;
}

#map_canvas img {
  max-width: none;
}

fieldset {
  border: 0;
  margin: 0;
  padding: 0;
}

button,
input,
select,
textarea {
  font-size: 100%;
  margin: 0;
  vertical-align: middle;
}
button,
input {
  overflow: visible;
  line-height: normal;
}
button::-moz-focus-inner,
input::-moz-focus-inner {
  padding: 0;
  border: 0;
}
button,
input[type='button'],
input[type='reset'],
input[type='submit'] {
  cursor: pointer;
  -webkit-appearance: button;
}
input[type='search'] {
  box-sizing: content-box;
  -webkit-appearance: textfield;
}
input[type='search']::-webkit-search-decoration,
input[type='search']::-webkit-search-cancel-button {
  -webkit-appearance: none;
}
textarea {
  overflow: auto;
  vertical-align: top;
}
